import React from 'react';
import Project from '../Project';
// import placeholder from '../../images/Placeholder.jpeg';

const projects = [
    {
        img: {avatar},
        alt: 'Placeholder',
        name: 'Placeholder',
        url: 'URL: Placeholder',
        repo: 'GitHub: Placeholder'
    },
    {
        img: 'data:image/png;base64,',
        alt: 'Placeholder',
        name: 'Placeholder',
        url: 'URL: Placeholder',
        repo: 'GitHub: Placeholder'
    }
]

function Portfolio() {
    return (
        <div>
            <h1>Portfolio</h1>
            {/* <Projects
                img='data:image/png;base64,'
                alt='Placeholder'
                name='Placeholder'
                url='URL: Placeholder'
                repo='GitHub: Placeholder'
            /> */}
            <Project projects={projects} />
        </div>
    );
}

export default Portfolio
